import React from "react";
import Spinner from "react-bootstrap/Spinner";

const LoadingBox = () => {
  return (
    <Spinner animation='border' role='statux'>
      <span className='visually-hidden'>Loading...</span>
    </Spinner>
  );
};

export default LoadingBox;
